(3,'...','2025-05-29 14:12:29.728489',2,83,3,1,NULL,0),
(4,'가나다라마바사\r\n','2025-05-29 14:17:42.283128',3,84,3,0,NULL,0),
(5,'한 회계연도를 넘어 계속하여 지출할 필요가 있을 때에는 정부는 연한을 정하여 계속비로서 국회의 의결을 얻어야 한다. 정당의 설립은 자유이며, 복수정당제는 보장된다.\n\n행정각부의 장은 국무위원 중에서 국무총리의 제청으로 대통령이 임명한다. 법률안에 이의가 있을 때에는 대통령은 제1항의 기간내에 이의서를 붙여 국회로 환부하고, 그 재의를 요구할 수 있다. 국회의 폐회중에도 또한 같다.','2025-05-29 15:06:39.958130',2,84,3,4,NULL,0),
(7,'의원을 제명하려면 국회재적의원 3분의 2 이상의 찬성이 있어야 한다.\r\n\r\n국가안전보장회의는 대통령이 주재한다. 모든 국민은 법률이 정하는 바에 의하여 납세의 의무를 진다.','2025-05-29 17:21:38.718978',0,79,4,0,NULL,0),
(8,'저작자·발명가·과학기술자와 예술가의 권리는 법률로써 보호한다.\r\n\r\n국가의 세입·세출의 결산, 국가 및 법률이 정한 단체의 회계검사와 행정기관 및 공무원의 직무에 관한 감찰을 하기 위하여 대통령 소속하에 감사원을 둔다.\r\n\r\n대통령은 헌법과 법률이 정하는 바에 의하여 국군을 통수한다.','2025-05-29 17:28:08.858549',1,79,4,0,NULL,0),
